import React, { Component } from "react";

export default class addQuestion extends Component {
  render() {
    return (
      <div className="App-header">
        <form>
          <label>
            Imię:
            <input type="text" name="name" />
          </label>
          <input type="submit" value="Wyślij" />
        </form>
      </div>
    );
  }
}
